make zahradny_nabytok_suma,hidden on t421 when { !zahradny_nabytok.rawValue }

make view_zahradny_nabytok_poistne,hidden on t421 when { !zahradny_nabytok.rawValue }

change zahradny_nabytok_suma value { init }

change view_zahradny_nabytok_poistne value { init }


change view_zahradny_nabytok_poistne value {
if (zahradny_nabytok.rawValue)
return ((zahradny_nabytok_suma.rawValue*koeficient_domacnost_spoluucast.rawValue*15.0)/1000.0) as Double
return view_zahradny_nabytok_poistne.rawValue as Double
}


